css:
.github-StubItem-git-tab-controller,
.github-GitTabItem-root {
  flex: 1;
  display: flex;
}
.github-Panel {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: -apple-system, BlinkMacSystemFont, "helvetica neue", "Ubuntu", "Segoe UI", sans-serif;
  font-size: 11px;
  color: #666d81;
  -webkit-user-select: none;
  cursor: default;
}
.github-Panel.no-repository {
  padding: 48px;
  text-align: center;
}
.github-Panel.is-loading {
  color: #41505e;
}
.github-Panel.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Panel.no-repository > * {
  margin: 16px 0;
}
.github-Panel.no-repository .git-logo-path {
  fill: #333843;
}
.github-Panel.no-repository .btn.btn-primary {
  overflow: hidden;
  text-overflow: ellipsis;
}
atom-dock.bottom .github-Panel {
  flex-direction: row;
}
atom-dock.bottom .github-StagingView {
  display: contents;
}
atom-dock.bottom .github-Panel > div {
  flex: 1;
}
atom-dock.bottom .github-StagedChanges {
  border-left: 1px solid #2a2f38;
  border-right: 1px solid #2a2f38;
}
atom-dock.bottom .github-StagingView-header {
  flex-wrap: wrap;
}
atom-dock.bottom .github-StagingView-group:first-child .github-StagingView-header {
  border-top: 1px solid #2a2f38;
}
atom-dock.bottom .github-RecentCommits {
  max-height: none;
  border-left: 1px solid #2a2f38;
}
